import Logo from '../SourceFiles/Header/Logo.png'

function Header() {
    const [Manu,setManu] = useState({
        item : ['Haqq覺m覺zda', 'Mentorlar',],
        Account : {
            class : 'fas fa-user',
            text : ''
        }
    })

    const [UserClick, setUserClick] = useState(false);




    return (
        <div id = 'header'>
            <div id = 'header-block' className = 'container'>
                <div id = 'flexcontainer' className = 'flex'>
                    <div id = 'header-logo'>
                        <img src = {Logo}/>
                    </div>
                    <div id = 'header-manu'>
                        <nav>
                            <ul className = 'flex'>
                            {Manu.item.map(item => {
                                return(
                                    <li>{item}</li>
                                )
                            })}
                            <li className = {Manu.Account.class}>{Manu.Account.text}</li>
                            </ul>
                        </nav>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default Header
